import React from 'react';
import './App.css';

function App() {
  return (
    <nav className='navbar navbar-expand-lg navbar-dark main-color py-3'>
      <div className="container-fluid">
          <span className='navbar-brand'>Luv 2 read</span>
          <button className='navbar-toggler' type='button' data-bs-toggle="collapse" data-bs-target='#navbarNavDropdown'></button>
      </div>
    </nav>
  );
}
export default App;
